import React from 'react';
import './App.css';
import Admin from './Features/Admin/Admin';
/* router */
import { BrowserRouter as Router,Switch } from 'react-router-dom';

function App () {
  return (

    <Router>
      <div className="App">
        <Switch >
          <Admin></Admin>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
